/** @format */

import React from "react";
import Button from "@material-ui/core/Button";

const Navbar = () => {
  return (
    <>
      <div className="container Navbar">
        <div className="row ">
          <div className="col-md-6 logoo">
            <h1>
              Usman<span style={{ color: "yellowGreen" }}>Khalid</span>{" "}
            </h1>
          </div>
          <div className="col-md-6 Navlinks  ">
            <ul className="d-flex justify-content-end ">
              <li>
                <a href="facebook.com">Home</a>
              </li>
              <li>
                <a href="facebook.com">Services</a>
              </li>
              <li>
                <a href="facebook.com">About</a>
              </li>
              <li>
                <a href="facebook.com">Contact</a>
              </li>
            </ul>
          </div>
        </div>
      </div>
    </>
  );
};
const Footer = () => {
  return (
    <div className="footer">
      <h1>Â© 2020 UsmanKhalid. All Rights Reserved | Terms and Conditions</h1>
    </div>
  );
};
const Comman = () => {
  return (
    <>
      <div className="container commanBody">
        <div className="row">
          <div className="col-md-6 tag">
            <h1>Grow your business with UsmanKhalid</h1>
            <p>We are the team of talented developer making websites</p>
            <Button>usman</Button>
          </div>
          <div className="col-md-6 Fimg">Get Started</div>
        </div>
      </div>
    </>
  );
};
export default Comman;
